# 计算留存率的差异（Delta）
delta_1 = retention_1_B - retention_1_A
delta_7 = retention_7_B - retention_7_A

# 计算p1 p2 p等指标
n_A = df[df['version'] == 'A'].shape[0]
n_B = df[df['version'] == 'B'].shape[0]

retention_1_p1 = retention_1_A
retention_1_p2 = retention_1_B

